import React from 'react';
import { Link } from 'react-router-dom';
import "./SecondPage.css";

const SecondPage = () => (
  <div className="SecondPage">
    <h1>SecondPage</h1>
    <Link to="/detection">Click to Start!</Link>
    <div className="song-asl">SongASL</div>
        <img
          className="logonote"
          src="logonote.png"
        />
  </div>

);

export default SecondPage;
